import React from 'react'
import Deposit from '../Components/Deposit/Deposit'
import Header from '../Components/Header/Header'
document.body.style='background:black'
const Depositpage = () => {
  return (
    <div>
      <Header/>
      <Deposit/>
    </div>
  )
}

export default Depositpage
